import Link from 'next/link';
import withLayout from '../components/Layout';

const PostArticle = props => {
  <li>
  <Link href={`/post?title=${props.title}`}>
    <a>{props.title}</a>
  </Link>
</li>
}


const Index = () => {
  return (
    <>
      <h1>My Blog</h1>
      <ul>
        <PostArticle title="Hello Next.js" />
        <PostArticle title="Learn Next.js is awesome" />
        <PostArticle title="Deploy apps with Zeit" />
      </ul>
    </>
  )
}

export default withLayout(Index);
